    YOW += y[6]*imw[6]; /*H2 */
    YOW += y[7]*imw[7]; /*C2H6 */
    YOW += y[8]*imw[8]; /*CO */
    YOW += y[9]*imw[9]; /*C6H6 */
    YOW += y[10]*imw[10]; /*C2H2 */
    YOW += y[11]*imw[11]; /*C6H5CH3 */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*O2 */
    YOW += y[14]*imw[14]; /*H */
