    YOW += y[25]*imw[25]; /*CO2 */
    YOW += y[26]*imw[26]; /*C2H3 */
    YOW += y[27]*imw[27]; /*C2H5 */
    YOW += y[28]*imw[28]; /*HCCO */
    YOW += y[29]*imw[29]; /*CH2CO */
    YOW += y[30]*imw[30]; /*CH2CHO */
    YOW += y[31]*imw[31]; /*aC3H5 */
    YOW += y[32]*imw[32]; /*nC3H7 */
    YOW += y[33]*imw[33]; /*cC4H5 */
    YOW += y[34]*imw[34]; /*C5H4O */
    YOW += y[35]*imw[35]; /*C5H5 */
    YOW += y[36]*imw[36]; /*C6H5 */
    YOW += y[37]*imw[37]; /*C6H5CH2 */
    YOW += y[38]*imw[38]; /*C6H5O */
    YOW += y[39]*imw[39]; /*C6H5CO */
    YOW += y[40]*imw[40]; /*C6H5CHO */
    YOW += y[41]*imw[41]; /*A2C11H21 */
    YOW += y[42]*imw[42]; /*A2C11H21O2 */
