void CKCTX(amrex::Real *  c, amrex::Real *  x)
{
    int id; /*loop counter */
    amrex::Real sumC = 0; 

    /*compute sum of c  */
    for (id = 0; id < 48; ++id) {
        sumC += c[id];
    }

    /* See Eq 13  */
    amrex::Real sumCinv = 1.0/sumC;
    for (id = 0; id < 48; ++id) {
        x[id] = c[id]*sumCinv;
    }

    return;
}


/*convert c[species] (molar conc) to y[species] (mass fracs) */
void CKCTY(amrex::Real *  c, amrex::Real *  y)
{
    amrex::Real CW = 0; /*See Eq 12 in CK Manual */
    /*compute denominator in eq 12 first */
    CW += c[0]*154.297990; /*POSF10325 */
    CW += c[1]*28.054180; /*C2H4 */
    CW += c[2]*16.043030; /*CH4 */
    CW += c[3]*42.081270; /*C3H6 */
    CW += c[4]*56.108360; /*iC4H8 */
    CW += c[5]*56.108360; /*C4H81 */
    CW += c[6]*2.015940; /*H2 */
    CW += c[7]*30.070120; /*C2H6 */
    CW += c[8]*28.010550; /*CO */
    CW += c[9]*78.114720; /*C6H6 */
    CW += c[10]*26.038240; /*C2H2 */
    CW += c[11]*92.141810; /*C6H5CH3 */
    CW += c[12]*15.035060; /*CH3 */
    CW += c[13]*31.998800; /*O2 */
    CW += c[14]*1.007970; /*H */
    CW += c[15]*17.007370; /*OH */
    CW += c[16]*33.006770; /*HO2 */
    CW += c[17]*15.999400; /*O */
    CW += c[18]*18.015340; /*H2O */
    CW += c[19]*34.014740; /*H2O2 */
    CW += c[20]*14.027090; /*CH2 */
    CW += c[21]*14.027090; /*CH2* */
    CW += c[22]*29.018520; /*HCO */
    CW += c[23]*30.026490; /*CH2O */
    CW += c[24]*31.034460; /*CH3O */
    CW += c[25]*44.009950; /*CO2 */
    CW += c[26]*27.046210; /*C2H3 */
    CW += c[27]*29.062150; /*C2H5 */
    CW += c[28]*41.029670; /*HCCO */
    CW += c[29]*42.037640; /*CH2CO */
    CW += c[30]*43.045610; /*CH2CHO */
    CW += c[31]*41.073300; /*aC3H5 */
    CW += c[32]*43.089240; /*nC3H7 */
    CW += c[33]*53.084450; /*cC4H5 */
    CW += c[34]*80.087030; /*C5H4O */
    CW += c[35]*65.095600; /*C5H5 */
    CW += c[36]*77.106750; /*C6H5 */
    CW += c[37]*91.133840; /*C6H5CH2 */
    CW += c[38]*93.106150; /*C6H5O */
    CW += c[39]*105.117300; /*C6H5CO */
    CW += c[40]*106.125270; /*C6H5CHO */
    CW += c[41]*153.290020; /*A2C11H21 */
    CW += c[42]*185.288820; /*A2C11H21O2 */
    CW += c[43]*185.288820; /*A2C11H20OOH */
    CW += c[44]*152.282050; /*A2C11H20 */
    CW += c[45]*217.287620; /*A2C11H21O4 */
    CW += c[46]*200.280250; /*A2C11H20O3 */
    CW += c[47]*28.013400; /*N2 */
    /*Now compute conversion */
    amrex::Real CWinv = 1.0/CW;
    y[0] = c[0]*154.297990*CWinv; 
    y[1] = c[1]*28.054180*CWinv; 
    y[2] = c[2]*16.043030*CWinv; 
    y[3] = c[3]*42.081270*CWinv; 
    y[4] = c[4]*56.108360*CWinv; 
    y[5] = c[5]*56.108360*CWinv; 
    y[6] = c[6]*2.015940*CWinv; 
    y[7] = c[7]*30.070120*CWinv; 
    y[8] = c[8]*28.010550*CWinv; 
    y[9] = c[9]*78.114720*CWinv; 
    y[10] = c[10]*26.038240*CWinv; 
    y[11] = c[11]*92.141810*CWinv; 
    y[12] = c[12]*15.035060*CWinv; 
    y[13] = c[13]*31.998800*CWinv; 
    y[14] = c[14]*1.007970*CWinv; 
    y[15] = c[15]*17.007370*CWinv; 
    y[16] = c[16]*33.006770*CWinv; 
    y[17] = c[17]*15.999400*CWinv; 
    y[18] = c[18]*18.015340*CWinv; 
    y[19] = c[19]*34.014740*CWinv; 
    y[20] = c[20]*14.027090*CWinv; 
    y[21] = c[21]*14.027090*CWinv; 
    y[22] = c[22]*29.018520*CWinv; 
    y[23] = c[23]*30.026490*CWinv; 
    y[24] = c[24]*31.034460*CWinv; 
    y[25] = c[25]*44.009950*CWinv; 
    y[26] = c[26]*27.046210*CWinv; 
    y[27] = c[27]*29.062150*CWinv; 
    y[28] = c[28]*41.029670*CWinv; 
    y[29] = c[29]*42.037640*CWinv; 
    y[30] = c[30]*43.045610*CWinv; 
    y[31] = c[31]*41.073300*CWinv; 
    y[32] = c[32]*43.089240*CWinv; 
    y[33] = c[33]*53.084450*CWinv; 
    y[34] = c[34]*80.087030*CWinv; 
    y[35] = c[35]*65.095600*CWinv; 
    y[36] = c[36]*77.106750*CWinv; 
    y[37] = c[37]*91.133840*CWinv; 
    y[38] = c[38]*93.106150*CWinv; 
    y[39] = c[39]*105.117300*CWinv; 
    y[40] = c[40]*106.125270*CWinv; 
    y[41] = c[41]*153.290020*CWinv; 
    y[42] = c[42]*185.288820*CWinv; 
    y[43] = c[43]*185.288820*CWinv; 
    y[44] = c[44]*152.282050*CWinv; 
    y[45] = c[45]*217.287620*CWinv; 
    y[46] = c[46]*200.280250*CWinv; 
    y[47] = c[47]*28.013400*CWinv; 

    return;
}


/*get Cp/R as a function of T  */
/*for all species (Eq 19) */
void CKCPOR(amrex::Real *  T, amrex::Real *  cpor)
{
    amrex::Real tT = *T; /*temporary temperature */
    amrex::Real tc[] = { 0, tT, tT*tT, tT*tT*tT, tT*tT*tT*tT }; /*temperature cache */
    cp_R(cpor, tc);
}


