    amrex::Real c[48]; /*temporary storage */
    amrex::Real YOW = 0; 
    amrex::Real PWORT; 
    /*Compute inverse of mean molecular wt first */
    YOW += y[0]*imw[0]; /*POSF10325 */
    YOW += y[1]*imw[1]; /*C2H4 */
    YOW += y[2]*imw[2]; /*CH4 */
    YOW += y[3]*imw[3]; /*C3H6 */
    YOW += y[4]*imw[4]; /*iC4H8 */
