        k_r = k_f / Kc;
        q_r = phi_r * k_r;
        qdot = q_f - q_r;
        wdot[13*npt+i] -= qdot;
        wdot[29*npt+i] += qdot;
        wdot[30*npt+i] += qdot;
        wdot[33*npt+i] -= qdot;

        /*reaction 253: cC4H5 <=> C2H3 + C2H2 */
        phi_f = sc[33*npt+i];
        k_f = k_f_s[252*npt+i];
        q_f = phi_f * k_f;
        phi_r = sc[10*npt+i]*sc[26*npt+i];
        Kc = Kc_s[252*npt+i];
        k_r = k_f / Kc;
        q_r = phi_r * k_r;
        qdot = q_f - q_r;
        wdot[10*npt+i] += qdot;
        wdot[26*npt+i] += qdot;
        wdot[33*npt+i] -= qdot;

        /*reaction 254: C3H6 + C3H6 <=> aC3H5 + nC3H7 */
        phi_f = sc[3*npt+i]*sc[3*npt+i];
        k_f = k_f_s[253*npt+i];
