    J[696] += dqdci;              /* dwdot[C2H2]/d[H] */
    J[700] -= dqdci;              /* dwdot[H]/d[H] */
    J[719] -= dqdci;              /* dwdot[cC4H5]/d[H] */
    /* d()/d[cC4H5] */
    dqdci =  + k_f*sc[14];
    J[1618] += dqdci;             /* dwdot[C2H4]/d[cC4H5] */
    J[1627] += dqdci;             /* dwdot[C2H2]/d[cC4H5] */
    J[1631] -= dqdci;             /* dwdot[H]/d[cC4H5] */
    J[1650] -= dqdci;             /* dwdot[cC4H5]/d[cC4H5] */
    /* d()/dT */
    J[2353] += dqdT;              /* dwdot[C2H4]/dT */
    J[2362] += dqdT;              /* dwdot[C2H2]/dT */
    J[2366] -= dqdT;              /* dwdot[H]/dT */
    J[2385] -= dqdT;              /* dwdot[cC4H5]/dT */

    /*reaction 251: cC4H5 + O <=> CH2CHO + C2H2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[17]*sc[33];
    k_f = prefactor_units[250] * fwd_A[250]
                * exp(fwd_beta[250] * tc[0] - activation_units[250] * fwd_Ea[250] * invT);
    dlnkfdT = fwd_beta[250] * invT + activation_units[250] * fwd_Ea[250] * invT2;
    /* reverse */
    phi_r = sc[10]*sc[30];
    Kc = exp(-g_RT[10] + g_RT[17] - g_RT[30] + g_RT[33]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[17] + h_RT[33]) + (h_RT[10] + h_RT[30]));
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
    /* rate of progress */
    q = k_f*phi_f - k_r*phi_r;
    dqdT = (dlnkfdT*k_f*phi_f - dkrdT*phi_r);
    /* update wdot */
